contracts/bank.sol.content:
pragma solidity ^0.4.24;

contract bank{
    int bal=0;

    function deposite_money(int amt) public returns(int bal) {
        bal+=amt;
        return bal;
        
    }

    function withdraw(int amt) public returns(int bal){
        bal-=amt;
        return bal;
    }

    function getBalance() public view returns(int bal) {
        return bal;
    }
}

